Magpie

```json
{
  "application": "Magpie",
  "description": "Magpie is a tool for running Hadoop on traditional HPC systems.",
  "software": [
    "Hadoop",
    "Tensorflow",
    "Horovod",
    "SLURM"
  ],
  "resource_requirements": {
    "nodes": "<my_node_count>",
    "time": "<my_time_in_minutes>",
    "partition": "<my_partition>",
    "job_name": "<my_job_name>",
    "local_directory": "/tmp/${USER}/magpie",
    "python_path": "/usr/bin/python"
  },
  "customizations": {
    "tensorflow_horovod": {
      "setup": "yes",
      "local_directory": "/tmp/${USER}/tensorflow-horovod",
      "job": "synthetic-benchmark",
      "parameters": "MAGPIE_TF_SYNTHETIC_BENCHMARK_PARAMETERS"
    }
  },
  "scripts": {
    "pre_job": "MAGPIE_PRE_JOB_RUN",
    "post_job": "MAGPIE_POST_JOB_RUN",
    "pre_execute": "MAGPIE_PRE_EXECUTE_RUN",
    "post_execute": "MAGPIE_POST_EXECUTE_RUN"
  }
}
```
